export default function register(){
    fetch("https://localhost:44317/api/Profil", {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({
                Felhasznalonev: document.getElementById("fnev").value,
                Jelszo: document.getElementById("passwd").value,
                Email: document.getElementById("email").value,
                Telefonszam: document.getElementById("fnev").value,
                TeljesNev: document.getElementById("fnev").value,
                Telepules: {
                  Iranyitoszam: 0,
                  TelepulesNev: document.getElementById("fnev").value
                }
        })
    })
        .then((response) => {
            if (!response.ok) {
                if (response.status === 409) {
                    alert("Ez az e-mail cím már regisztrálva van.")
                }
                else {

                    throw new Error(`HTTP hiba! Státuszkód: ${response.status}`)
                }
            }
            else {
                document.getElementById("valt").click()
                console.log(response.status)
                alert("Sikeres regisztráció!")
            }
            //return response.json()
        })
        .catch((error) => {
            console.error("Hiba történt:", error);
            alert("Server hiba. Kérlek próbáld meg később!");
        })
}
